yzing this data, I will give the director of marketing my findings, insights, and recommendations regarding the new marketing strategy.\n","\n","### 1.2 - Scope / Major Project Activities: \n","\n","* Ask questions about the project: Ask effective questions to try to understand the business task and the question that needs to be answered, which was assigned by the director of marketing at Cyclistic.\n","* Prepare the data: Set a timetable to finalize the project.Since the data has been collected, identify which data to be downloaded and analyzed. Download the bikes ride data for the year 2019 Q1 and 2020 Q1.Verify that the data downloaded is accurate, sufficient, useful, and reliable for answering questions\n","* Process the data: Examine, organize, and clean the data: remove any inconsistencies, duplicates, fill in missing values, etc.\n","* Analyze the data: Do the necessary data analysis to uncover answers and solutions: calculate averages, count items in categories, in order to examine trends and patterns.\n","* Share the outcome: Present my findings through a report and visualizations\n","* Act on the data: Put the data insights into action, by implementing new marketing strategies, which means give recommendations to the executives’ team.\n","\n","### 1.3 - This project does not include:\n","Due to the large size of files, this project does not include the bikes ride outside of the Year 2109 Q1 (Jan, Feb, Mar) and Year 2020 Q1 (Jan, Feb, Mar).\n","\n","### 1.4 - Deliverables: Deliverable Description/ Details\n","\n","* Data Visualizations:\n","Pie Charts, Line charts, and bar charts of the bikes ride data\n","* Findings:\n","Findings about the data\n","* Insights:\n","Insights about the data\n","* Recommendations:\n","Recommendations based on the findings and insights\n","* Final Report:\n","A final report detailing the data analysis, including the tables and numbers, and graphs. \n","\n","### 1.5 - Schedule Overview / Major Milestones: \n","\n","* Data Collection and Cleaning: 21/08/2024: Collect, examine, and clean the ride bikes data\n","* Data Analysis: 23/08/2024: Initial data analysis completed\n","* Data Visualizations: 27/08/2024: Showing how the annual members and casual customers differ\n","* Recommendations: 28/08/2024: Recommending a marketing strategy targeting casual riders to become annual members\n","* Final Report: 30/08/2024: Final report detailing all work, analysis, methodologies, and findings.\n","\n","### 1.6 - Estimated date for completion:\n","30-August-2024\n","\n"]},{"cell_type":"markdown","id":"4f7a8b3c","metadata":{"execution":{"iopub.execute_input":"2024-08-31T12:14:50.61588Z","iopub.status.busy":"2024-08-31T12:14:50.613864Z","iopub.status.idle":"2024-08-31T12:14:50.629068Z"},"papermill":{"duration":0.011317,"end_time":"2024-09-12T19:54:31.326528","exception":false,"start_time":"2024-09-12T19:54:31.315211","status":"completed"},"tags":[]},"source":["# 2 - Business Question\n","How do annual members and casual riders use Cyclistic bikes differently?"]},{"cell_type":"markdown","id":"725e953d","metadata":{"papermill":{"duration":0.01148,"end_time":"2024-09-12T19:54:31.349383","exception":false,"start_time":"2024-09-12T19:54:31.337903","status":"completed"},"tags":[]},"source":["# 3 - Analysis Process\n","\n","## 3.1 - Ask Phase \n","#### (A clear understanding of the Business Task and understanding the audience and the stakeholders)\n","As a Junior Data Analyst, I am working under the Cyclistic marketing analytics team to study the bike trips data in order to help the Director of Marketing answer his first question on how annual members and casual riders differ in order to identify trends and help determine the marketing plan to turn casual riders into annual members.\n","My insights can help the Director of Marketing design a marketing strategy which will be based on data analysis, and which will be most likely approved by the Cyclistic Executive team due to its reliability on actual data.\n","The Business Task is analyzing the Cyclistic historical bike trip data in order to better understand how annual members and casual riders differ.\n","The key Stakeholders are: (i) the Director of Marketing; (ii) the Cyclistic Executive team "]},{"cell_type":"markdown","id":"5e217373","metadata":{"papermill":{"duration":0.011235,"end_time":"2024-09-12T19:54:31.372008","exception":false,"start_time":"2024-09-12T19:54:31.360773","status":"completed"},"tags":[]},"source":["## 3.2 - Prepare Phase \n","#### (A description of all data sources used and data integrity, unbiased, and license)\n","The data was collected by Cyclists company and stored in the company’s own system/database and was produced into excel sheets, which means it is first-party data.\n","Some of the data was organized by year and month, and some of the data was organized quarterly. The data has been made available by Motivate International Inc. \n","This is public data that anyone can use to explore how different customer types are using Cyclistic bikes, but data-privacy issues prohibit using riders’ personally identifiable information (This means that you won’t be able to connect pass purchases to credit card numbers to determine if casual riders live in the Cyclistic service area or if they have purchased multiple single passes.) \n","The data has been made available by the above-mentioned Incorporation under a license linked to the data. The data is structured, because it is generated in tables in excel sheets but the data needs cleaning and preparation.\n","After the data has been downloaded, cleaning, organizing, and sorting the data phase will begin, and then analyzing the clean data will help me answer my question by telling me how the annual members and casual riders differ."]},{"cell_type":"markdown","id":"99b97404","metadata":{"papermill":{"duration":0.011372,"end_time":"2024-09-12T19:54:31.395195","exception":false,"start_time":"2024-09-12T19:54:31.383823","status":"completed"},"tags":[]},"source":["## 3.3 - Process Phase \n","#### (Documentation of any cleaning or manipulation of data)\n","Since the data is large data, it is so slow to use Excel Spreadsheet to clean and manipulate the data, so I used both Excel spreadsheet and SQL for the review and cleaning process. \n","\n","Using Excel spreadsheet, I started the cleaning process, examining the data, recognizing and remedying dirty data as follow:\n","\n","* I checked for misspelling\n","* I checked the date and time formatting\n","* I checked the fields length to validate data using the LENGTH function\n","* I created a column to add the rides length (In doing so, I noticed a few errors in the data sheet Divvy_Trips_2020_Q1): \n","* There was an error in the trip ID 157EAA4C4A3C8D36 row. The end station is Null, and since I cannot investigate, given that I cannot go back to the data entry team, I deleted the record, reducing the number of rows from 426,888 to 426,887. \n","* There was an error in the ride lengths of 26 trips. In some cases, the start time and end time are the same and in other cases the start time comes after the end time, and since I cannot investigate, given that I cannot go back to the data entry team and check with them, I deleted the records, reducing the number of rows from 426,887 to 426,861.\n","* In the dataset Divvy_Trips_2020_Q1, there was a few trip IDs that were scientific equations instead of just numbers, when I converted them to numbers, some numbers were 30 characters, so I used the LEN function to check and correct the trip IDs, for data consistency and easier analysis.\n","* In the dataset Divvy_Trips_2020_Q1, I renamed the column “ride_id” => “trip_id”, to match the column name in the Divvy_Trips_2019_Q1, for data consistency and easier analysis.\n","* In the dataset Divvy_Trips_2020_Q1, I renamed the column “started_at” => “start_time”, to match the column name in the Divvy_Trips_2019_Q1, for data consistency and easier analysis.\n","* In the dataset Divvy_Trips_2020_Q1, I renamed the column “ended_at” => “end_time”, to match the column name in the Divvy_Trips_2019_Q1, for data consistency and easier analysis.\n","* In the dataset Divvy_Trips_2019_Q1, I renamed the column “from_station_id” => “start_station_id”, to match the column name in the Divvy_Trips_2020_Q1, for data consistency and easier analysis.\n","* In the dataset Divvy_Trips_2019_Q1, I renamed the column “from_station_name” => “start_station_name”, to match the column name in the Divvy_Trips_2020_Q1, for data consistency and easier analysis.\n","* In the dataset Divvy_Trips_2019_Q1, I renamed the column “to_station_id” => “end_station_id”, to match the column name in the Divvy_Trips_2020_Q1, for data consistency and easier analysis.\n","* In the dataset Divvy_Trips_2019_Q1, I renamed the column “to_station_name” => “end_station_name”, to match the column name in the Divvy_Trips_2020_Q1, for data consistency and easier analysis.\n","* In the dataset Divvy_Trips_2020_Q1, I renamed the column “member_casual” => “usertype”, to match the column name in the Divvy_Trips_2019_Q1, for data consistency and easier analysis.\n","* In the dataset Divvy_Trips_2019_Q1, in the “usertype” column, I replaced the word “Subscriber” with “member” and the word “Customer” with “casual” to match the data in the “usertype” column (member and casual) in the Divvy_Trips_2020_Q1, for data consistency and easier analysis.\n","* In the dataset Divvy_Trips_2020_Q1, I deleted the following columns: “start_lat”, “start_lng”, “end_lat”, and “end_lng”, due to irrelevance.\n","* In the dataset Divvy_Trips_2020_Q1, I deleted the columns “rideable_type”, due to irrelevance.\n","* In the dataset Divvy_Trips_2019_Q1, I deleted the colum “bike_id”, due to irrelevance.\n","* In the dataset Divvy_Trips_2020_Q1, I created a column “trip_duration”  and used the ride length to multiply it by 86400 (the number of seconds in a day)\n","* In the dataset Divvy_Trips_2019_Q1, I renamed the colum “tripduration” into “trip_duration” in order to be consistent with the dataset Divvy_Trips_2020_Q1. \n","* In both datasets, I changed the data type of the trip_duration column from general to number (integer).\n","* I created a column to add the day of the week.\n","\n","Then, I uploaded the dataset into the BigQuery console, and continued the cleaning process on BigQuery using SQL, including:\n","\n","* Checking for duplicates using the DISCTINCT and COUNT Functions\n","* Checking for Null cells and verifying that the null cells do not affect the data outcome using the NULL function (the null cells for the gender and birth year of the users do not affect the outcome of the analysis)\n","* Checking for spaces in data using the TRIM function\n","\n","After cleaning the data, I verified its credibility and usefulness to the business task, by rechecking the clean dataset and doing some manual cleanups when/if needed, while looking at the big picture, considering the business problem, the goal, and the data, to confirm that the data-cleaning occurred meets business expectations.\n","\n","Then I uploaded the clean dataset in R for analysis."]},{"cell_type":"code","execution_count":2,"id":"921852f0","metadata":{"execution":{"iopub.execute_input":"2024-09-12T19:54:31.455724Z","iopub.status.busy":"2024-09-12T19:54:31.420136Z","iopub.status.idle":"2024-09-12T19:54:31.484847Z","shell.execute_reply":"2024-09-12T19:54:31.482937Z"},"papermill":{"duration":0.080953,"end_time":"2024-09-12T19:54:31.487494","exception":false,"start_time":"2024-09-12T19:54:31.406541","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n","</style>\n","<ol class=list-inline><li>'divvy_trips_2019_q1.csv'</li><li>'divvy_trips_2020_q1.csv'</li></ol>\n"],"text/latex":["\\begin{enumerate*}\n","\\item 'divvy\\_trips